import React from "react";
import basket from "../assets/basket.svg";

export default function Like({ like, closeCart, removeToCart }) {
  return (
    <div>
      <h2>Preferiti</h2>
      {like.map((el, index) => {
        <h2>{el.name}</h2>;
      })}
      <button onClick={closeCart}>Chiudi</button>
      <a onClick={() => removeToCart}>
        <img src={basket}></img>
      </a>
    </div>
  );
}
